import React from 'react';
import FormSignUp from '../components/Form/formSignUp';

function SignUp() {
    const [isSubmitting, setIsSubmitting] = useState(false);

    function submitForm() {
        setIsSubmitting(true);
    }

    return (
        <FormSignUp />
    )
}

export default SignUp
